import { useEffect } from 'react'

const Home = () => {
    const {state, setState}= useState({
        longitud: 0,
        latitud: 0
    })
    useEffect(() => {
        navigator.geolocation.getCurrentPosition(function (position) {
            setState({
                longitud:position.coords.lo
            })
         }, function (error) { })
    })
    return (
        <div>
            <h1>Home</h1>
        </div>
    )
}

export default Home
